window.bookSummaryJSON = "Lots of books claim they can change your life. But how many actually teach you how to take the many small steps that lead to success each and every day of your life? Now in <i>Today Matters</i>, motivational teacher and best-selling author John C. Maxwell shows you how to seize the day. In this hands-on and inspiring guide he offers twelve daily practices to help you control your daily agenda, make time for people you love, and find success in your career. There's a great time to begin a more successful life. It's called today."; 
